const GroceryListItem = () => {
    return (
    <div className='grocery_list'>
        <div></div>
        <p>{item.name}</p>
        <img src={item.image} alt=''></img>
        <p>{item.category}</p>
        <p>{item.aisle}</p>
    </div>
)
}

export default GroceryListItem
